const Navbar2 = () => {
    const [first, setFirst] = useState(0)
  return (
    <nav className="bg-white">
      <div className="flex items-center font-medium justify-around">
        <div className="z-50 p-5 md:w-auto w-full flex justify-between md:" >
          <img src="./assets/mymassa.png" className="md:cursor-pointer h-9" />
          <div className="text-3xl">
          <GiHamburgerMenu/>
          </div>
        </div>
       
        <ul className="md:flex hidden flex uppercase items-center gap-8">
          <li>
            <a href="http://" className="py-7 px-3 inline-block">
              Home
            </a>
          </li>
          <Navlink />
        </ul>
        <div className="md:block hidden">
          <Button />
        </div>
        {/* Mobile  */}
        <ul className={`
        md:hidden bg-white absolute w-full h-full bottom-0 py-24 pl-4
            `}>
          <li >
            <a href="http://" className="py-7 px-3 inline-block">
              MASA SANDALYE TAKIM
            </a>
          </li>
          <Navlink/>
          <div className="py-5">
<Button/>
          </div>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar2;
